$.isNW=function(n){return n===undefined||n===null||n.toString().trim().length===0};$.timeFormat=function(n,t="MM/DD/YYYY hh:mm:ss A"){if(!$.isNW(n)){var i=new moment.utc(n).tz("America/Los_Angeles");return i.format(t)}};$.dateFormat=function(n,t="MM/DD/YYYY"){if(!$.isNW(n)){var i=new moment.utc(n);return i.format(t)}};$.isSuccess=function(n){return n===""};$.getScrollTop=function(){var n=0,t=0;return document.body&&(n=document.body.scrollTop),document.documentElement&&(t=document.documentElement.scrollTop),n-t>0?n:t};$.getScrollHeight=function(){var n=0,t=0;return document.body&&(n=document.body.scrollHeight),document.documentElement&&(t=document.documentElement.scrollHeight),n-t>0?n:t};$.getWindowHeight=function(){return document.compatMode==="CSS1Compat"?document.documentElement.clientHeight:document.body.clientHeight};$.pic=function(n,t=350,i=350){return $.isNW(n)?"https://eec.oss-us-west-1.aliyuncs.com/r/nopic.png?x-oss-process=image/resize,m_lfit,h_"+i+",w_"+t:n+"?x-oss-process=image/resize,m_lfit,h_"+i+",w_"+t};Vue.component("itembox",{props:["item"],template:"#item-box",methods:{addToCart:function(n){$.post("/api/shoppingcart/item",{Item:{ItemNo:n.ItemNo,Qty:n.Qty}},function(){})},createdTime:function(n){return $.timeFormat(n.createdOnUtc)}}});